import React from 'react';

class Add extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            activeTab: "FLIGHT"
        }
    }

    changeTab(tabName) {
        this.setState({activeTab: tabName});
    }
    renderTabs() {
        return (
            <div className="tabs">
                <button className={this.state.activeTab == 'FLIGHT' ? "tab active": "tab"} onClick={()=>{this.changeTab('FLIGHT')}}>London</button>
                <button className={this.state.activeTab == 'EVENT' ? "tab active": "tab"} onClick={()=>{this.changeTab('EVENT')}}>Paris</button>
                <button className={this.state.activeTab == 'MEETING' ? "tab active": "tab"} onClick={()=>{this.changeTab('MEETING')}}>Tokyo</button>
            </div>
        )
    }
    render() {
        return(
            <div>
                {this.renderTabs()}
                <p>Hello World</p>
            </div>

        )
    }
}

export default Add;
